import React from 'react'
import { Progress, Row, Col } from 'antd'
function Stats(props){
    console.log(props)
    function showStats(data){
        let result=null
        result=data.map(valus=>{
            return(
                <Row>
                    <Col span={6}> {valus.stat}</Col>
                    <Col span={18}><Progress percent={50} steps={18} /> <br/></Col>
                </Row>
            )
        })
        return result
    }
    return(
        <div>
        {showStats(props.data)}
        </div>
    )
}
export default Stats
